import atlLogo from './logos/atlLogo.png';
import bufLogo from './logos/bufLogo.png';
import carLogo from './logos/carLogo.png';
import chiLogo from './logos/chiLogo.png';
import cinLogo from './logos/cinLogo.png';
import cleLogo from './logos/cleLogo.png';
import cltLogo from './logos/cltLogo.png';
import crdLogo from './logos/crdLogo.png';
import dalLogo from './logos/dalLogo.png';
import denLogo from './logos/denLogo.png';
import detLogo from './logos/detLogo.png';
import gnbLogo from './logos/gnbLogo.png';
import htxLogo from './logos/htxLogo.png';
import jaxLogo from './logos/jaxLogo.png';
import kanLogo from './logos/kanLogo.png';
import miaLogo from './logos/miaLogo.png';
import minLogo from './logos/minLogo.png';
import norLogo from './logos/norLogo.png';
import nweLogo from './logos/nweLogo.png';
import nygLogo from './logos/nygLogo.png';
import nyjLogo from './logos/nyjLogo.png';
import otiLogo from './logos/otiLogo.png';
import phiLogo from './logos/phiLogo.png';
import pitLogo from './logos/pitLogo.png';
import raiLogo from './logos/raiLogo.png';
import ramLogo from './logos/ramLogo.png';
import ravLogo from './logos/ravLogo.png';
import sdgLogo from './logos/sdgLogo.png';
import seaLogo from './logos/seaLogo.png';
import sfoLogo from './logos/sfoLogo.png';
import tamLogo from './logos/tamLogo.png';
import wasLogo from './logos/wasLogo.png';
import './HomePage.css';


function NFCNorth() {
  return (
    <div>
    <table id="customers">
      <tr>
        <th>NORTH</th>
      </tr>
      <tr>
        <td><img class="logos" src={chiLogo} alt="logo" width="87" height="87"/></td>
      </tr>
      <tr>
        <td><img class="logos" src={gnbLogo} alt="logo" width="87" height="87"/></td>
      </tr>
      <tr>
        <td><img class="logos" src={detLogo} alt="logo" width="87" height="87"/></td>
      </tr>
      <tr>
        <td><img class="logos" src={minLogo} alt="logo" width="87" height="87"/></td>
      </tr>
    </table>
    </div>
  );
}

function NFCSouth() {
  return (
    <div>
    <table id="customers">
      <tr>
        <th>SOUTH</th>
      </tr>
      <tr>
        <td><img class="logos" src={atlLogo} alt="logo" width="87" height="87"/></td>
      </tr>
      <tr>
        <td><img class="logos" src={carLogo} alt="logo" width="87" height="87"/></td>
      </tr>
      <tr>
        <td><img class="logos" src={tamLogo} alt="logo" width="87" height="87"/></td>
      </tr>
      <tr>
        <td><img class="logos" src={norLogo} alt="logo" width="87" height="87"/></td>
      </tr>
    </table>
    </div>
  );
}

function NFCEast() {
  return (
    <div>
    <table id="customers">
      <tr>
        <th>EAST</th>
      </tr>
      <tr>
        <td><img class="logos" src={dalLogo} alt="logo" width="87" height="87"/></td>
      </tr>
      <tr>
        <td><img class="logos" src={nygLogo} alt="logo" width="87" height="87"/></td>
      </tr>
      <tr>
        <td><img class="logos" src={phiLogo} alt="logo" width="87" height="87"/></td>
      </tr>
      <tr>
        <td><img class="logos" src={wasLogo} alt="logo" width="87" height="87"/></td>
      </tr>
    </table>
    </div>
  );
}

function NFCWest() {
  return (
    <div>
    <table id="customers">
      <tr>
        <th>WEST</th>
      </tr>
      <tr>
        <td><img class="logos" src={sfoLogo} alt="logo" width="87" height="87"/></td>
      </tr>
      <tr>
        <td><img class="logos" src={crdLogo} alt="logo" width="87" height="87"/></td>
      </tr>
      <tr>
        <td><img class="logos" src={ramLogo} alt="logo" width="87" height="87"/></td>
      </tr>
      <tr>
        <td><img class="logos" src={seaLogo} alt="logo" width="87" height="87"/></td>
      </tr>
    </table>
    </div>
  );
}


function AFCNorth() {
  return (
    <div>
    <table id="customers">
      <tr>
        <th>NORTH</th>
      </tr>
      <tr>
        <td><img class="logos" src={cleLogo} alt="logo" width="87" height="87"/></td>
      </tr>
      <tr>
        <td><img class="logos" src={ravLogo} alt="logo" width="87" height="87"/></td>
      </tr>
      <tr>
        <td><img class="logos" src={pitLogo} alt="logo" width="87" height="87"/></td>
      </tr>
      <tr>
        <td><img class="logos" src={cinLogo} alt="logo" width="87" height="87"/></td>
      </tr>
    </table>
    </div>
  );
}

function AFCSouth() {
  return (
    <div>
    <table id="customers">
      <tr>
        <th>SOUTH</th>
      </tr>
      <tr>
        <td><img class="logos" src={htxLogo} alt="logo" width="87" height="87"/></td>
      </tr>
      <tr>
        <td><img class="logos" src={cltLogo} alt="logo" width="87" height="87"/></td>
      </tr>
      <tr>
        <td><img class="logos" src={otiLogo} alt="logo" width="87" height="87"/></td>
      </tr>
      <tr>
        <td><img class="logos" src={jaxLogo} alt="logo" width="87" height="87"/></td>
      </tr>
    </table>
    </div>
  );
}

function AFCEast() {
  return (
    <div>
    <table id="customers">
      <tr>
        <th>EAST</th>
      </tr>
      <tr>
        <td><img class="logos" src={bufLogo} alt="logo" width="87" height="87"/></td>
      </tr>
      <tr>
        <td><img class="logos" src={nweLogo} alt="logo" width="87" height="87"/></td>
      </tr>
      <tr>
        <td><img class="logos" src={nyjLogo} alt="logo" width="87" height="87"/></td>
      </tr>
      <tr>
        <td><img class="logos" src={miaLogo} alt="logo" width="87" height="87"/></td>
      </tr>
    </table>
    </div>
  );
}

function AFCWest() {
  return (
    <div>
    <table id="customers">
      <tr>
        <th>WEST</th>
      </tr>
      <tr>
        <td><img class="logos" src={raiLogo} alt="logo" width="87" height="87"/></td>
      </tr>
      <tr>
        <td><img class="logos" src={denLogo} alt="logo" width="87" height="87"/></td>
      </tr>
      <tr>
        <td><img class="logos" src={kanLogo} alt="logo" width="87" height="87"/></td>
      </tr>
      <tr>
        <td>
          <button>
            <img class="logos" src={sdgLogo} alt="logo" width="87" height="87"/>
          </button>
        </td>
      </tr>
    </table>
    </div>
  );
}


function HomePage() {
  return (
    <table id="conf">
      <tr>
        <td>
          <table class="confTable">
            <tr>
              <th colspan="4">NFC</th>
            </tr>
            <tr>
              <td> <NFCNorth/> </td>
              <td> <NFCSouth/> </td>
              <td> <NFCEast/> </td>
              <td> <NFCWest/> </td>
            </tr>
          </table>
        </td>
        <td>
          <table class="confTable">
            <tr>
              <th colspan="4">AFC</th>
            </tr>
            <tr>
              <td> <AFCNorth/> </td>
              <td> <AFCSouth/> </td>
              <td> <AFCEast/> </td>
              <td> <AFCWest/> </td>
            </tr>
          </table>
        </td>
      </tr>
    </table>
  );
}

export default HomePage;
